import React from 'react';
import Card from '../../../../components/shared/Card/Card';
import Button from '../../../../components/shared/Button/Button';

const Email = () => {
  return (
    <Card title="Enter email ID" icon="email-emoji">

    <div>
        <Button  text="Next"/>
    </div>

    </Card>
  )
};

export default Email;
